return function()
    local base64Font = ""
    function patched.fonts.cache:Register_Font(Name, Weight, Style, Asset)
        if not isfolder("patched") then makefolder("patched") end
        local asset = "patched/" .. Asset.Id
        local font = "patched/" .. Name .. ".font"
        if not isfile(asset) then writefile(asset, Asset.Font) end
        writefile(font, environment.HttpService:JSONEncode({ name = Name, faces = {{ name = "Regular", weight = Weight, style = Style, assetId = getcustomasset(asset) }} }))
        return getcustomasset(font)
    end
    patched.fonts.options = {
        Templeos = Font.new(patched.fonts.cache:Register_Font("Templeos", 400, "normal", { Id = "Templeos.ttf", Font = crypt.base64.decode(base64Font) }))
    }
end
